<!DOCTYPE html>
<html lang="ko">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1, viewport-fit=cover" />
<title>곧 돌아오겠습니다 · Enjoy</title>
<meta name="robots" content="noindex, nofollow">
<meta name="color-scheme" content="dark">
<style>
  :root{ --bg:#000; --ink:#f5f7fb; --sub:#a6adbb; }
  *{box-sizing:border-box} html,body{height:100%}
  body{
    margin:0; background:var(--bg); color:var(--ink);
    font-family:-apple-system,BlinkMacSystemFont,"SF Pro Display","SF Pro Text",
    system-ui,Segoe UI,Roboto,"Noto Sans KR","Apple SD Gothic Neo",Helvetica,Arial,sans-serif;
    display:grid; place-items:center; overflow:hidden;
  }
  .stage{position:fixed; inset:0; pointer-events:none; z-index:0;
    background: radial-gradient(60% 80% at 50% -20%, rgba(255,255,255,.14), transparent 55%),
                radial-gradient(120% 100% at 50% 120%, rgba(255,255,255,.10), transparent 60%);
    filter:saturate(120%);}
  .floor{position:fixed; left:50%; bottom:-6vh; transform:translateX(-50%);
    width:min(1100px,92vw); height:min(1100px,92vw); border-radius:50%;
    background: radial-gradient(closest-side, rgba(255,255,255,.16), transparent 65%);
    filter: blur(28px) saturate(120%); opacity:.22; pointer-events:none; z-index:0;}
  .wrap{position:relative; z-index:1; width:min(1100px,92vw); text-align:center; padding:clamp(18px,4vw,48px);}
  .char{width:min(320px,48vw); margin:0 auto; filter: drop-shadow(0 18px 40px rgba(0,0,0,.45));
    transform-origin:70% 20%; animation: wave 2.6s ease-in-out infinite;}
  @keyframes wave{0%,100%{transform:rotate(0) translateY(0)}40%{transform:rotate(4deg) translateY(-2px)}60%{transform:rotate(2deg)}}
  .copy{ margin-top: 80px; }
  .overline{font-size:12px; letter-spacing:.24em; text-transform:uppercase; color:var(--sub); margin:6px 0 10px;}
  h1{margin:0 0 10px; font-weight:900; font-size:clamp(40px,9vw,112px); line-height:.96; letter-spacing:-.02em;}
  .lede{margin:0 auto; max-width:70ch; color:var(--sub); font-size:clamp(16px,2.2vw,20px); line-height:1.9;}
  .lede br{display:block}

  .unmute{
    position: fixed; right: calc(14px + env(safe-area-inset-right)); bottom: calc(14px + env(safe-area-inset-bottom)); z-index: 9999;
    display:none; gap:10px; align-items:center;
    font-size:15px; color: var(--ink);
    background: rgba(255,255,255,.10);
    border:1px solid rgba(255,255,255,.16);
    border-radius: 999px; padding:12px 16px; cursor:pointer;
    -webkit-tap-highlight-color: transparent;
    box-shadow: 0 8px 26px rgba(0,0,0,.35);
  }
  .unmute.show{ display:inline-flex }
  .unmute .dot{ width:10px; height:10px; border-radius:999px; background:#fff; opacity:.9 }
  .unmute .icon{ width:16px; height:16px; display:inline-block; opacity:.95 }
  @media (hover:none) and (pointer:coarse) {
    /* On mobile, prefer showing by default until audio unmuted */
    .unmute{ display:inline-flex }
  }
</style>
</head>

    const MIME = "audio/mpeg";
    const el = document.getElementById('bgm');
    const btn = document.getElementById('unmute');
    el.src = "data:"+MIME+";base64," + AUDIO_BASE64;
    el.volume = 1.0;

    // Show the button by default on touch/mobile (safety)
    const isMobile = matchMedia('(hover: none) and (pointer: coarse)').matches;
    if (isMobile) btn.classList.add('show');

    function tryMutedAutoplay(){
      el.muted = true;
      el.play().then(() => {
        // Even if muted playback works, keep button visible on mobile until user taps it.
        if (!isMobile) {
          setTimeout(() => {
            if (navigator.userActivation && navigator.userActivation.hasBeenActive) el.muted = false;
            else btn.classList.add('show');
          }, 300);
        } else {
          btn.classList.add('show');
        }
      }).catch(() => btn.classList.add('show'));
    }

    function resumeWithSound(){
      el.muted = false;
      if (el.paused) el.play().catch(()=>{});
      if (window.AudioContext) { try { (new AudioContext()).resume(); } catch(_ ){} }
      btn.classList.remove('show');
      window.removeEventListener('pointerdown', resumeWithSound);
      window.removeEventListener('keydown', resumeWithSound);
      window.removeEventListener('touchstart', resumeWithSound);
    }

    tryMutedAutoplay();
    btn.addEventListener('click', resumeWithSound, {passive:true});
    window.addEventListener('pointerdown', resumeWithSound, {passive:true});
    window.addEventListener('keydown', resumeWithSound);
    window.addEventListener('touchstart', resumeWithSound, {passive:true});

    setInterval(()=>location.reload(),60000);
  </script>
